;text/plain&#x27;});\\n\\n      // If we are replacing a previously generated file we need to\\n      // manually revoke the object URL to avoid memory leaks.\\n      if (textFile !== null) {\\n        window.URL.revokeObjectURL(textFile);\\n      }\\n\\n      textFile = window.URL.createObjectURL(data);\\n\\n      return textFile;\\n    };\\n\\n    var link = document.createElement(&#x27;a&#x27;);\\n    // link.setAttribute(&#x27;download&#x27;, &#x27;exoplots_download.txt&#x27;);\\n    link.setAttribute(&#x27;target&#x27;, &#x27;_blank&#x27;);\\n    link.href = makeTextFile(makeCSV(sources, keys, header));\\n    document.body.appendChild(link);\\n\\n    // wait for the link to be added to the document\\n    window.requestAnimationFrame(function() {\\n      var event = new MouseEvent(&#x27;click&#x27;);\\n      link.dispatchEvent(event);\\n      document.body.removeChild(link);\\n    });\\n    "}}]]]},"styles":{"type":"map","entries":[["margin","auto 5px"]]},"label":"Download CSV of Selected Data"}},{"type":"object","name":"Div","id":"p5938","attributes":{"styles":{"type":"map","entries":[["margin","auto -3px auto 5px"]]},"text":"Kepler:"}},{"type":"object","name":"ColorPicker","id":"p5939","attributes":{"js_property_callbacks":{"type":"map","entries":[["change:color",[{"type":"object","name":"CustomJS","id":"p5940","attributes":{"args":{"type":"map","entries":[["other",{"type":"object","name":"Scatter","id":"p5822","attributes":{"x":{"type":"field","field":"insolation"},"y":{"type":"field","field":"met"},"size":{"type":"value","value":6},"line_color":{"type":"value","value":"#228833"},"line_alpha":{"type":"value","value":0.4},"fill_color":{"type":"value","value":"#228833"},"fill_alpha":{"type":"value","value":0.4},"hatch_color":{"type":"value","value":"#228833"},"hatch_alpha":{"type":"value","value":0.4},"marker":{"type":"value","value":"circle_cross"}}}]]},"code":"other.fill_color = this.color"}},{"type":"object","name":"CustomJS","id":"p5941","attributes":{"args
